-- ----------------------------
-- Table structure for topologies
-- ----------------------------
DROP TABLE IF EXISTS `topologies`;
CREATE TABLE `topologies`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '图纸名称',
  `image` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '图纸缩略图url',
  `pens` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '图纸画布节点连线数据',
  `component` tinyint(1) NULL DEFAULT NULL COMMENT '图纸类型： 0 - 图纸；1 - “我创建的”组件',
  `componentData` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '如果为 “我创建的”组件，则为复合组件内容',
  `userId` bigint(0) NULL DEFAULT NULL COMMENT '所属用户',
  `class` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '所属分类名称',
  `folderId` bigint(0) NULL DEFAULT NULL COMMENT '所属文件夹',
  `lineName` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '图纸选项：默认连线类型',
  `fromArrow` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '图纸选项：默认起始箭头',
  `toArrow` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '图纸选项：默认终点箭头',
  `scale` int(0) NULL DEFAULT NULL COMMENT '图纸缩放比例',
  `locked` int(0) NULL DEFAULT NULL COMMENT '图纸是否锁定',
  `websocket` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'websocket连接地址',
  `mqttUrl` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'mqtt连接地址',
  `mqttOptions` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'mqtt连接选项',
  `users_permissions_user` int          null,
  `published_at`          datetime     null,
  `created_by`             int          null,
  `updated_by`             int          null,
  `created_at`            timestamp    null,
  `updated_at`             timestamp    null,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

